    <?php foreach($pages as $page) { 
            $id = $page->getCollectionID();
            $itemCategoryList = new PageList();
            $itemCategoryList->filterByParentID($id);
            $itemCategoryList->filterByPageTypeHandle('item_category');
            $itemCategoryList->sortByDisplayOrder();
            $itemCategories = $itemCategoryList->getResults();
        ?>
    <div class="accordion-parent" data-id="<?php echo $id ?>">
        <div class="accordion">
            <?php foreach($itemCategories as $itemCategory) { 
                $itemCategoryTitle = $itemCategory->getCollectionName();
                $itemCategoryID = $itemCategory->getCollectionID();
                ?>
                <div class="accordion-item">
                    <div class="accordion-header"><h3><?php echo $itemCategoryTitle ?></h3><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none"><path fill-rule="evenodd" clip-rule="evenodd" d="M5 8L12 16L19 8H5Z" fill="#715220"/></svg></div>
                    <div class="accordion-content">
                        <div class="accordion-content-inner">
                            <?php 
                            $itemList = new PageList();
                            $itemList->filterByParentID($itemCategoryID);
                            $itemList->filterByPageTypeHandle('item');
                            $itemList->sortByDisplayOrder();
                            $items = $itemList->getResults();
                            foreach($items as $item) {
                                $itemTitle = $item->getCollectionName();
                                $itemPrice = 800;
                                $itemDescription = $item->getCollectionDescription();
                                ?>
                                <div class="food-card">
                                    <h3><?php echo $itemTitle ?></h3>
                                    <p class="price">₹<?php echo $itemPrice ?></p>
                                    <p><?php echo $itemDescription ?></p>
                                </div>
                            <?php } ?>
                        </div>
                    </div>
                </div>
            <?php } ?>
        </div>
    </div>
    <?php } ?>
</section>

<script>


$(function () {
  var taeb = $(".taeb-switch");

  taeb.find(".taeb").on("click", function () {
    var $this = $(this);

    if ($this.hasClass("active")) return;

    // Handle tab switch direction
    var direction = $this.attr("taeb-direction");
    taeb.removeClass("left right").addClass(direction);
    taeb.find(".taeb.active").removeClass("active");
    $this.addClass("active");

    // Handle fade accordions
    var id = $this.data("id");

    $(".accordion-parent:visible").fadeOut(300, function () {
      $('.accordion-parent[data-id="' + id + '"]').fadeIn(300);
    });
  });
});




$(document).ready(function () {
  $(".accordion-header").click(function () {
    $(this).next(".accordion-content").stop(true, true).slideToggle();
    $(this).find("svg").toggleClass("open");
  });
});


</script>